import styled from "styled-components";
import { fontColour } from "../../global/colours";

const PageWrapper = styled.section`
  display: flex;
  height: 60vh;
  margin: 0;
  padding: 0;
  position: relative;
`;

const Image = styled.img`
  position: absolute;
  left: 10%;
  top: 30%;
  width: 80%;
`;

const Circle = styled.img`
  // margin: 25% 0;
  //   position: absolute;
  width: 100%;
`;

const jointText = `
    color: ${fontColour}`;

const TopText = styled.h2`
  ${jointText};
`;

const BottomText = styled.h2`
  ${jointText};
`;

export { PageWrapper, Image, Circle, TopText, BottomText };
